import React, { useState} from 'react';
import Joke from './Joke'

function App(){
	return(
	<>
		<Joke data={
			{question:"what's your name?",
			punchline:"why should I say",}
			}
		/>
		<Joke data={
			{question:"hello",
			punchline:"bye",}
			}
		/>
		<Joke data={
			{question:"good bye",
			punchline:"ok ok, never see you again",}
			}
		/>
		</>
		)
		}
export default App;
